import React, { Component } from 'react'
import './HeaderLayout.scss';

function clear() {
  var a = document.getElementsByClassName('search')[0];
  a.value = "";
}

export default class HeaderComponent extends Component {

  render() {
    return (
      <div className="search topNav">
        <div>
        <input type="text" className="search txt" placeholder="Tìm kiếm theo id, phone, email, facebook, ..." />
        </div>
        <button className="search btn">Tim</button>
      </div>
    )
  }
}
